  false,\n\t\"url\": null,\n\t\"notes\": \"This metadata is for the vegetation and
  land-use geo-spatial database for Zion National Park and surrounding areas. The
  project is authorized as part of the USGS/NPS Vegetation Mapping Program. The program
  is being administered by the Biological Resources Division (BRD), United States
  Geological Survey (USGS). The USGS/BRD is responsible for overall management and
  oversight of all ongoing mapping efforts. This mapping effort was performed by the
  U.S. Bureau of Reclamation's (USBR) Remote Sensing and GIS Group, Technical Service
  Center, Denver, Colorado and NatureServe (formally The Nature Conservancy). The
  vegetation mapping program is part of a larger Inventory and Monitoring (I&M) program
  started by the National Park Service (NPS).\",\n\t\"license_title\": null,\n\t\"extras\":
